import React from 'react'
import './Card.css';

const Card = (props) => {
  return (
    <div className='card'>
      <ul>
        <li>{props.people[0].name}</li>
        <li>{props.people[0].birthday}</li>
        {/* {props.people.map((person) => {
        <>
          <li key='1'>person.name</li>
          <li key='2'>person.birthday</li>
        </>
        })} */}
      </ul>
    </div>
  )
}

export default Card
